module.exports = JSON.parse('{"data-heading1":"Cómo Colecionamos La Data","data-heading2":"Data y Análisis","data_p1":"Nuestro equipo coleccionó dos tipos de datos: cualitativos y cuantitativos. Los datos cualitativos se coleccionaron por medio de encuestas y entrevistas centradas en los aspectos sociales que afectan a las personas con Long Covid. Estos datos se anonimizaron para proteger a la privacidad de los participantes, eliminando cualquier indicador identificativo. Los datos cuantitativos se coleccionaron por la técnica llamada web scraping y la agregación de datos demográficos de los condados de Grant, Douglas, Okanogan, Lincoln, Ferry, Stevens y Pend Oreille. Estos datos se obtuvieron principalmente del Censo de EE.UU., el Departamento de Salud del Estado de Washington, la Oficina de Estadísticas Laborales y el Centro de Investigación Pew. Para garantizar la precisión y la coherencia, limpiamos y normalizamos estos conjuntos de datos utilizando Jupyter Notebook.","data_p2":"Basado en nuestra amplia investigación, hemos determinado que aproximadamente 90,000 Latinos pueden estar sufriendo del Long Covid, representando aproximadamente 9-10% de la población Latina. Personas con condiciones más severas de hospitalización tienen una mayor probabilidad de desarrollar el Long Covid. Los menores de 18 años tienen una menor probabilidad de desarrollar el Long Covid, en cambio, los mayores tienen la probabilidad más alta. Nuestra investigación también indica que las latinas tienen una probabilidad relativamente más alta de desarrollar el Long Covid. Incluso entre los individuos que no fueron hospitalizados, las mujeres tienen aproximadamente un 6% más de probabilidad de experimentar el Long Covid en comparación con los hombres.","form-title":"Mándanos Su Data","form-content":"¡Comparte sus propias experiencias con el Long Covid para ayudarnos!","form-content2":"Tenemos un formulario de Google que puede rellenar. ¡Su envío de datos nos ayudará mucho en nuestra investigación!","form-legend":"Su Información","form-description":"¿Cuál es su experiencia con el Long Covid?","SUBMIT":"ENVIAR"}');

